import React, { useState, useEffect } from "react";
import Button from "../Button";
import { createDeck } from "../../utils/api";

  function DeckSubmit(event, formData, setFormData, initialFormData) {
    event.preventDefault();
    useEffect(() => {
      const abortController = new AbortController();
  
      Promise.resolve(createDeck(formData, abortController.signal))
        .then((console.log))
        .catch((error) => console.log(error));
      return () => abortController.abort();
    }, []);
    
    
    setFormData(initialFormData);
    return <Button type="submit" onClick={DeckSubmit}>Submit</Button>;
  }
  
  export default DeckSubmit;
